const MenuBtn = ({type,toggle,className}) => {
    className = 'fas fa-bars '+ className
    return (
        <div>
           <i type={type} data-bs-toggle={toggle} aria-expanded="false" className={className}></i>
        </div>
    )
}

export default MenuBtn
